import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container , Row, Col} from 'react-bootstrap';
import './Map.css';
import { toBeRequired } from "@testing-library/jest-dom/dist/matchers";
function Map()
{
    return(
        <div className="main">
            <Container fluid>
                <Row>
                    <Col md={6}><img class="img-responsive" src={require('./chennaimap.jpg')}/>
                    <Col md={6}></Col>
                    </Col>
                </Row>
            </Container>
            
        </div>

    );
}
export default Map;
